import LoggedFilm from "./LoggedFilm";
import "./"

const EntriesList = props => {
    let filmLogContent = <p>No films logged for this year!</p>;

    if (props.entries.length > 0) {
        filmLogContent = props.entries.map((entry) => (
            <LoggedFilm
                key={entry.id}
                title={entry.title}
                rating={entry.rating}
                date={entry.date}
            />
        ))
    }

    return <ul className="entries-list">

    </ul>
};

export default EntriesList;
